import { BrowserRouter, Route } from "react-router-dom";
import HomePage from "./pages/HomePage";

function App() {
  return (
    <BrowserRouter>
      <Route to="/" element={<HomePage />} />
    </BrowserRouter>
  );
}

export default App;
